import BaseLayout from "../components/BaseLayout";
import FoldersHeaderBar from "../components/FoldersHeaderBar";
import { Container, Row, Col } from "react-bootstrap";

const Katalog = () => {
  return (
    <BaseLayout title="Katalog spraw">
      <Container>
        <Row className="gry-box">
          <FoldersHeaderBar />
        </Row>
      </Container>
    </BaseLayout>
  );
};

export default Katalog;
